import { useState } from "react"

const UserCard = ({userActivity}) => {

    const [showMore, toggleShowMore] = useState(false)

    const setShowMore = () => {
        toggleShowMore(!showMore)
    }

    return (
        <div>
            <img src={userActivity.profilePicture ? userActivity.profilePicture : null }></img>
            <h3>{userActivity.firstName} {userActivity.lastName}</h3>
            <p>{userActivity.age}</p>
            <p>{userActivity.about}</p>
        </div>
    )
}

export default UserCard
